import React from 'react';
import Service from "./Service";
import  drop from "../../../../image/drop_down.svg"

function ServiceButton({name = "Выберите сервис", ref}) {
    return (
        <Service
            ref={ref}
            containerWidth={"20rem"}
            firstComponent={name}
            secondComponent={
                <img src={drop} alt=""/>
            }
            isButton={true}
        />
    );
}

export default React.forwardRef(ServiceButton);
